                        SELECT @saldo_awal := (
                            SELECT IFNULL(balance,0) FROM journals_temp WHERE account_id=vACCOUNT_ID AND type_name='Saldo Awal'
                        )
                    ) AS start_balance
                    CROSS JOIN (
                        SELECT 
